R amp アールアンプ No.4990　<BR><BR>適合車種はメーカーサイトにて確認お願いします。<A href="https://link.rakuten.co.jp/1/004/640/?url=OTHER/ramp_4990_10.shtml" target="top"><BR>
★適合表（メーカーサイトにリンク）</A>  <a href=https://www.rakuten.ne.jp/gold/autocenter/rakutengold/ultraramp.pdf>適合表PDF</a>ULTRA（ウルトラ）　永井電子　アールアンプ　ニッサン/マツダ　ＩＧコイルカプラオンタイプ NO.4990-10
<BR><BR>

ＥＣＵにエンジン回転信号（ＲＥＶ）の無い車種でタコメーター等用にREV信号を取り出すためのアンプとしてこのＲampが開発されました。旧来のRamp　No.4990同様に機能や特性など同一ですが、適合表に明記された一部の車種では、ECUへの配線接続ではなく、IGコイル側コネクターにカプラーオンするだけの簡単な接続で装着できるキットとしてこのNo.4990-10を設定しました。
<BR>※Ramp適合表　日産/マツダの一部指定モデルについてのみ適合します。
 <BR><BR>

■主な機能
<BR>●カプラーオンの簡単取付け
<BR>ＩＧコイルに接続するだけのカプラＯＮタイプの簡単な取付けを採用。面倒な配線も不要でアールアンプを取付けられます。
<BR>●安全設計
<BR>エンジンルームからバルクヘッドにアールアンプの出力線を１本だけ通して室内で配線しますが、万が一、この配線をフレームにショートしてしまった場合でもエンジンはもちろん、アールアンプにも影響しない安全設計を採用しました。 

<BR><BR>

永井電子製品での適合製品はNo.4010、4015、4016、4020、1930、1932、4500、4706となり、これらの製品の取り付けに際しては　このアダプターとの併用によって　REVモードの表示やタコメーターの表示が可能となります。<BR><BR>
※Ramp併用の必要車両についてのみ適合します。<style type="text/css">

